import React from 'react';
import { useSelector } from 'react-redux';

import tempIcon from '../../../assets/image/tempIcon.jpg'
import humidityIcon from '../../../assets/image/humidityIcon.png'
import precipitationIcon from '../../../assets/image/precipitationIcon.png'
import test from '../../../assets/image/test.jpg'

import { MainDetailsDailyWeatherWrapper } from './styledComponents/DetailsDailyWeather';

const DetailsDailyWeather = () => {
  const state = useSelector((state) => state);
  const { weather } = state;

  return (
    <MainDetailsDailyWeatherWrapper>
      <div style={{display: 'flex', alignItems: 'center'}}>
        <img 
          style={{width: '40px'}}
          src={tempIcon}
          alt='tempIcon'
        />
        temp :{Math.floor(weather?.main.temp)} feel likes {Math.floor(weather?.main.temp)}
        </div>
      <div>
        <img 
          style={{width: '30px'}}
          src={humidityIcon}
          alt='humidityIcon'
        />
        pressire: {weather?.main.pressure}
      </div>
      <div>
      <img 
          style={{width: '30px'}}
          src={test}
          alt='humidityIcon'
        />
        precipitation: {weather?.weather[0].description}
      </div>
      <div>wind: {weather?.wind.speed}</div>
    </MainDetailsDailyWeatherWrapper>
  );
};

export default DetailsDailyWeather;
